std::complex<double> DT::A1A1HS1Tree(const double &cos_t, const double &s)
{
    std::complex<double> MHSqcomp = std::complex<double>(MH*MH,-MH*WH);
    std::complex<double> MS1Sqcomp = std::complex<double>(MS1*MS1,-MS1*WS1);

    double t = ((-s + 2* (MA1*MA1) +  MHSqcomp.real() +  MS1Sqcomp.real() + cos_t*sqrt(s - 4* (MA1*MA1))*sqrt(( (MHSqcomp.real()*MHSqcomp.real()) - 2.* MHSqcomp.real()*(s +  MS1Sqcomp.real()) +  (( MS1Sqcomp.real() - s)*( MS1Sqcomp.real() - s)))/s))/2.);
	double u = -s - t + MA1*MA1 + MA1*MA1 + MHSqcomp.real() + MS1Sqcomp.real();

    return -((token15*token2*((MHSqcomp*(2.*MHSqcomp + MS1Sqcomp)*token10*token2)/((MHSqcomp - s)*token14) + (MS1Sqcomp*(MHSqcomp + 2.*MS1Sqcomp)*token15*token20)/((-MS1Sqcomp + s)*token14) + (-(MHSqcomp*token10*token2) + MS1Sqcomp*token15*token20)/token14 + (MHSqcomp*MS1Sqcomp)/(t -  (MA1*MA1)) + (MHSqcomp*MS1Sqcomp)/(u -  (MA1*MA1))))/ (token28*token28));
}

